import React from 'react';

import './Card.css';


const card = (props) => {
    return <div className="Card" key={props.index}>
        <h4>{props.name}</h4>

        {props.video ? `<iframe width="100%" height="315" src="https://www.youtube.com/embed/ ${props.video} " frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>` : null}

        {props.image ? `<img src="${props.image}" class="cardImage" >` : null}

        {props.quote ? `<h3 class="quote">${props.quote} </h4>` : null}

        <p className="desc">{props.desc}</p>
    </div>
};

export default card;
